Ką reiškia pykinimas apie menstruacijas ir kaip jį pašalinti?
Pykinimas prieš menstruacijas yra dažnas reiškinys. Daugeliu atvejų tokie nemaloni pojūčiai yra susiję su PMS, tačiau kai kuriais atvejais pykinimas gali rodyti nėštumą ar sunkią ligą. Ar galėtumėte vemti prieš menstruacijas ir kaip teisingai atpažinti simptomus, taip pat tokių nemalonių pojūčių priežastis?
Paprastai menstruacijų atėjimas jaučiamas kelias dienas. Daugumoje moterų simptomai yra panašūs: svorio padidėjimas maždaug 1-2 k
... 
mimas;
- silpnumas;
- pilvo skausmas;
- bėrimas;
- apetito padidėjimas / sumažėjimas;
- emocinė depresija ir tt
Yra tokių sutrikimų dėl hormonų pokyčių. Dėl palankios vaiko gimimo procesų moters kūne patenkina estrogeno ir progesterono hormonai. Jų santykiai vienas su kitu vaidina labai svarbų vaidmenį ir veikia "šeimininkės" sveikatos būklę.
Prieš menstruacijų atsiradimą, šių hormonų kiekis žymiai padidėja, nes gimda yra paruošta implantuoti apvaisintą kiaušialąstę. Jei tręšimo procesas nevykst
...
is simptomas atsiranda mergaitėje po pirmųjų mėnesinių, priežastis gali būti gimdos padėties anomalija. Kiti provokuojantys veiksniai yra hormoninis sutrikimas, toksinio šoko sindromas, nėštumas, kontraceptinių tablečių vartojimas. Norėdami atsikratyti nemalonių pojūčių menstruacijų metu, galite išgydyti tik jų atsiradimo priežastį. Bet kokių vaistų priėmimas leidžiamas tik su gydytojo leidimu. Padeda sumažinti sveiko gyvenimo būdo simptomų intensyvumą, vitaminų vartojimą ir subalansuotą mitybą.

Shaksuka yra nuostabus vėlyvų savaitgalio pusryčių pasirinkimas. O nuostabus – nes yra ne tik skanus, bet ir naudingas sveikatai patiekalas su daug daržovių ir baltymų. Puikiai tinka ir KETO mitybos šalininkams.
Dedame pomidorus (be pjaustant išbėgusio skysčio). Maišant viską kepiname dar geras 5 minutes ant vidutinės ugnies. Jei iš pomidorų išsiskyrė daug skysčio, ant silpnos ugnies paliekame kepti dar kelias minutes, kad skystis išgaruotų;
Tuomet keptuvėje, tarp daržovių, šaukštu, darome skyles kiaušiniams įmušti. Atsargiai įmušame kiaušinius ir keptuvę dedame į įkaitintą orkaitę 7 minutėms;
Orkaitėje viskas turėtų kepti tol, kol kiaušinio baltymas pasidarys baltos spalvos. Jei trynį mėgstate kietesnį, tuomet dar kelias minutes palaikykite orkaitėje. Visas kepimas orkaitėje turėtų užtrukti ne daugiau 10 minučių;
Serviruojam pagardindami feta suriu ir žolelėmis, šviežiomis salotomis.
P.S. Shakshuka galima pabaigti kepti ir keptuvėje ant plytelės. Įmušus kiaušinius reiktų palikti viską kepti ant vidutinės ugnies, kol kiaušinių baltymai pasidarys baltos spalvos.

Kai taip karšta, norisi gaivių, lengvų pusryčių, kurie neatimtų laiko gaminimui, o skrandis jaustųsi ilgai sotus ir neperkrautas. Tokiais pusryčiais gali tapti begliutenės pilno grūdo košės, praturtintos įvairiais riešutukais, sėklomis, geraisiais riebalais ir, žinoma, uogomis.
Pusryčiai po pušelėmis – 2 porcijoms reikės:
- 100 g ekologiškų soros kruopų;
- 60 g baltos bolivinės balandos sėklų;
- 450 g vandens;
- 2 v.š. kokoso drožlių;
- Žiupsnis druskos;
- 1 a.š. sviesto;
- 2 v.š. MCT aliejaus;
- 2 v.š. migdolo riešutų be luobelės;
- Sezoninių uogų 200-300g.
Pusryčiai po pušelėmis – gaminimo eiga:
- Kruopas/sėklas nuplauti po tekančiu vandeniu, suberti į puodą ir užpilti vandeniu. Palikti per naktį brinkti. Ryte nupilti vandenį, suberti kokoso drožles, įpilti nurodytą kiekį vandens, druskos ir užvirti. Po 2-3 minučių išjungti ir uždengti puodą rankšluosčiu. Košę šiltai užkloti ir palikti brinkti 20min.
- Patiekiant įmaišyti sviesto, aliejaus. Dubenėlyje pabarstyti košę riešutais ir uogomis. Norint saldžiau, rekomenduoju pašlakstyti kerobos sirupu arba Syrup Gold – eritritolio skysta versija.
